        <div className="col-sm-4">
          <Project imgsrc={App4} title="Password Generator" href="" />
        </div>
      </div>
      <div className="row">
        <div className="col-sm-4">
          <Project imgsrc={App2} title="Bootstrap Portfolio" href="" />
        </div>
        <div className="col-sm-4">
          <Project imgsrc={App2} title="Bootstrap Portfolio" href="" />
        </div>
        <div className="col-sm-4">
          <Project imgsrc={App2} title="Bootstrap Portfolio" href="" />
        </div>
      </div>
    </section>
  );
}

export default Projects;
